import{_ as e,o as t,c as o,O as n}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 24.2-657 Determination of vote on voting systems.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-657.md","filePath":"vacode/24.2-657.md"}'),r={name:"vacode/24.2-657.md"},s=n('<h1 id="§-24-2-657-determination-of-vote-on-voting-systems" tabindex="-1">§ 24.2-657 Determination of vote on voting systems. <a class="header-anchor" href="#§-24-2-657-determination-of-vote-on-voting-systems" aria-label="Permalink to &quot;§ 24.2-657 Determination of vote on voting systems.&quot;">​</a></h1><p>In the presence of all persons who may be present lawfully at the time, giving full view of the voting systems or printed return sheets, the officers of election shall determine and announce the results as shown by the counters or printed return sheets, including the votes recorded for each office on the write-in ballots, and shall also announce the vote on every question. The vote as registered shall be entered on the statement of results. When completed, the statement shall be compared with the number on the counters on the equipment or on the printed return sheets. If, on any ballot scanner, the number of persons voting in the election, or the number of votes cast for any office or on any question, totals more than the number of names on the pollbooks of persons voting on the machines, then the figures recorded by the machines shall be accepted as correct. A statement to that effect shall be entered by the officers of election in the space provided on the statement of results.</p><p>Code 1950, § 24-312; 1966, c. 453; 1970, c. 462, § 24.1-222; 1974, c. 428; 1979, c. 329; 1981, c. 425; 1983, c. 461; 1985, c. 458; 1993, c. 641; 2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0540" target="_blank" rel="noreferrer">540</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0576" target="_blank" rel="noreferrer">576</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0464" target="_blank" rel="noreferrer">464</a>.</p>',3),a=[s];function i(c,h,l,f,d,m){return t(),o("div",null,a)}const _=e(r,[["render",i]]);export{v as __pageData,_ as default};
